import React, { useState, useEffect } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import Paper from "@mui/material/Paper";

function Pets() {
  const [isLoaded, setIsLoaded] = useState(false);
  const [pets, setPets] = useState([]);
  const [formData, setFormData] = useState({
    animal: "",
    description: "",
    age: "",
    price: "",
  });
  const [updatePetId, setUpdatePetId] = useState(null);

  useEffect(() => {
    fetchPets();
  }, []);

  const fetchPets = () => {
    fetch("http://localhost:3001/api?act=getall")
      .then((res) => res.json())
      .then((result) => {
        setIsLoaded(true);
        setPets(result);
      });
  };

  const addPet = () => {
    fetch(
      `http://localhost:3001/api?act=add&animal=Dog&description=Dalmatian&age=3&price=103.45`
    )
      .then((res) => res.json())
      .then(() => {
        fetchPets();
      });
  };

  const deletePet = (id) => {
    fetch(`http://localhost:3001/api?act=delete&id=${id}`)
      .then((res) => res.json())
      .then(() => {
        fetchPets();
      });
  };

  const updatePet = (id, newData) => {
    fetch(
      `http://localhost:3001/api?act=update&id=1&animal=Parrot&description=Green&age=6&price=550.95`
    )
      .then((res) => res.json())
      .then(() => {
        fetchPets();
      });
  };
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleUpdate = () => {
    // Implement the updatePet functionality here
    // Use formData to send updated pet data to the server
    // After updating, reset updatePetId and formData, and fetch pets again
  };

  return (
    <div>
      <h1>Server API Usage Demonstration</h1>
      <h2>Pets</h2>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Animal</TableCell>
              <TableCell>Description</TableCell>
              <TableCell>Age</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Action</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {pets.map((pet) => (
              <TableRow key={pet.id}>
                <TableCell>{pet.id}</TableCell>
                <TableCell>{pet.animal}</TableCell>
                <TableCell>{pet.description}</TableCell>
                <TableCell>{pet.age}</TableCell>
                <TableCell>{pet.price}</TableCell>
                <TableCell>
                  <Button variant="contained" onClick={() => deletePet(pet.id)}>
                    Delete
                  </Button>
                  <Button variant="contained" onClick={() => updatePet(pet.id)}>
                    Update
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <br />
      {updatePetId && (
        <div>
          <h2>Update Pet</h2>
          <TextField
            label="Animal"
            name="animal"
            value={formData.animal}
            onChange={handleInputChange}
          />
          <TextField
            label="Description"
            name="description"
            value={formData.description}
            onChange={handleInputChange}
          />
          <TextField
            label="Age"
            name="age"
            value={formData.age}
            onChange={handleInputChange}
          />
          <TextField
            label="Price"
            name="price"
            value={formData.price}
            onChange={handleInputChange}
          />
          <Button variant="contained" onClick={handleUpdate}>
            Update Pet
          </Button>
          <br />
        </div>
      )}
    </div>
  );
}

export default Pets;
